package com.blob.reader;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Controller;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestParam;
import org.springframework.web.bind.annotation.GetMapping;

import java.io.*;
import javax.servlet.*;
import javax.servlet.http.*;

import com.memberreport.service.MemberReportService;


@Controller
@RequestMapping("/memberreport")
public class DBGifReaderController2 {
	
	@Autowired
	MemberReportService memberreportSvc;

	/*
	 * This method will serve as listOneEmp.html , listAllEmp.html handler.
	 */
	@GetMapping("DBGifReader")
	public void dBGifReader(@RequestParam("repId") String repId, HttpServletRequest req, HttpServletResponse res)
			                                                                                          throws IOException {
		res.setContentType("image/gif");
		ServletOutputStream out = res.getOutputStream();

		try {
			out.write(memberreportSvc.getOneMemberReport(Integer.valueOf(repId)).getRepPic());
		} catch (Exception e) {
			String defaultImg = "";
			byte[] buf = java.util.Base64.getDecoder().decode(defaultImg);
			out.write(buf);
		}
	}
}
